    test_humanizes() {
        if (this.assertEqual(this.wordlist.getHumanizedWord(), this.humanize(this.wordlist.getSnakeCaseWord()))) {
            console.log("* Passed random string test");
            this.numPassed++;
        } else {
            console.log("- Failed: Don't hardcode your answer! All our code is DYNAMIC!");
        }
    }
    
    testHumanize() {
        this.numPassed = 0;
        this.test_returns_empty_for_empty();                   this.printLine();
        this.test_returns_original_string_if_nothing_to_do();  this.printLine();
        this.test_returns_space_for_underscore();              this.printLine();
        this.test_employee_id_example();                       this.printLine();
        this.test_longer_example();                            this.printLine();
        this.test_humanizes();                                 this.printLine();
        if (this.numPassed === this.TEST_COUNT) {
            console.log("CONGRATULATIONS!!! You've passed all the test conditions! Well done!");
        } else {
            console.log(":-(    Keep trying.");
        }
    }
    
    testAll() {
        this.testHumanize();
    }
